"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Vein ablation (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H15095309\">",
"      <span class=\"h1\">",
"       What is vein ablation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Vein ablation is a procedure that is used to treat different types of vein disease. It works by sealing up or removing a diseased vein, so that blood cannot flow through it anymore. The blood that would normally flow through that vein finds another route back to the heart.",
"     </p>",
"     <p>",
"      Vein ablation is done only to people who have not gotten better with simpler treatments.",
"     </p>",
"     <p>",
"      Vein ablation can be done a few different ways:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Sclerotherapy",
"        </strong>",
"        &ndash; For this procedure, the doctor injects a chemical into the diseased vein that causes it to collapse on itself. The vein stays in place, but it no longer carries blood. Sclerotherapy can be done in a doctor&rsquo;s office with local anesthesia.",
"       </li>",
"       <li>",
"        <strong>",
"         Radiofrequency or laser ablation",
"        </strong>",
"        &ndash; For these procedures, the doctor inserts a special wire into the diseased vein. This wire heats up the vein and seals it from the inside (",
"        <a class=\"graphic graphic_figure graphicRef87609 \" href=\"UTD.htm?12/43/12978\">",
"         figure 1",
"        </a>",
"        ). The vein stays in place, but it no longer carries blood. These procedures involve no surgery and can be done with very little anesthesia. They can often be done in a doctor&rsquo;s office.",
"       </li>",
"       <li>",
"        <strong>",
"         Vein ligation or stripping",
"        </strong>",
"        &ndash; These procedures involve surgery to remove the diseased vein or veins. People who have these procedures must go under anesthesia and be treated in a hospital or surgery center. Veins are removed through many small cuts.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15095324\">",
"      <span class=\"h1\">",
"       Can I choose which procedure to have?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No, not usually. Your doctor will recommend which procedure would work for the type of vein problem you have.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15095339\">",
"      <span class=\"h1\">",
"       How do I prepare for vein ablation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on which procedure you will have. Your doctor will give you detailed instructions about your specific procedure.",
"     </p>",
"     <p>",
"      In general, people having sclerotherapy or radiofrequency or laser ablation just have to take a pill to calm them before the procedure. Some people have to stop taking certain medicines before the procedure, but that is not common. People having vein ligation or stripping have a more complicated preparation, because these procedures involve surgery.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15095356\">",
"      <span class=\"h1\">",
"       What happens after vein ablation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After having a vein ablation procedure, most people are asked to:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Walk around for a few minutes multiple times a day",
"       </li>",
"       <li>",
"        Avoid sitting or standing for too long",
"       </li>",
"       <li>",
"        Prop up their leg while sitting (for example on pillows)",
"       </li>",
"       <li>",
"        Avoid heavy lifting or exercise for 1 to 2 weeks after the procedure",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Depending on the type of ablation procedure you have, you might be asked to wear special bandages or stockings called &ldquo;compression&rdquo; bandages or stockings. These bandages or stockings will put steady pressure on your leg and can help prevent bruising.",
"     </p>",
"     <p>",
"      Also depending on what type of procedure you have, you might have to go back to the doctor a few days after your procedure for a test called an ultrasound. This is to make sure you have not developed any blood clots in your leg. It is very important that you have this test.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15095373\">",
"      <span class=\"h1\">",
"       What problems can happen after vein ablation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The problems that can happen are different for the different procedures. In general, the problems can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Blood clots in the legs",
"       </li>",
"       <li>",
"        Bleeding under the skin that forms a soft lump called a &ldquo;hematoma&rdquo;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People who have vein ligation or stripping can also have:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Wound infections",
"       </li>",
"       <li>",
"        Nerve damage",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15095390\">",
"      <span class=\"h1\">",
"       When should I call my doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Call your doctor or nurse right away if:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        You are wearing bandages or stockings and your leg or foot tingles or feels cool, or if the toes on the treated side turn white or purple &ndash; These symptoms probably mean that your bandages or stockings are too tight. You can remove them, but call your doctor or nurse, too.",
"       </li>",
"       <li>",
"        You have intense pain or swelling that does not get better with the pain medicines your doctor prescribed &ndash; These symptoms could be a sign that you have a clot in your leg.",
"       </li>",
"       <li>",
"        You bleed through your bandages even after the doctor has adjusted them, or you bleed and soak your bandages",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15095407\">",
"      <span class=\"h1\">",
"       More on this topic",
