"if(Height >= 116.5 && Height < 117){L = -0.3521; M = 20.9700; S = 0.09208;};",
"if(Height >= 117 && Height < 117.5){L = -0.3521; M = 21.1666; S = 0.09239;};",
"if(Height >= 117.5 && Height < 118){L = -0.3521; M = 21.3636; S = 0.09270;};",
"if(Height >= 118 && Height < 118.5){L = -0.3521; M = 21.5611; S = 0.09300;};",
"if(Height >= 118.5 && Height < 119){L = -0.3521; M = 21.7588; S = 0.09331;};",
"if(Height >= 119 && Height < 119.5){L = -0.3521; M = 21.9568; S = 0.09362;};",
"if(Height >= 119.5 && Height < 120){L = -0.3521; M = 22.1549; S = 0.09393;};",
"if(Height >= 120 && Height < 120.5){L = -0.3521; M = 22.3530; S = 0.09424;};",
"Z_Score_Weight_for_Height =  (power((Weight / M), L) - 1) / (L * S);",
"",
"if (doCalc) Z_Score_Weight_for_Height_param.value = fixDP(Z_Score_Weight_for_Height, dp);",
"",
"",
"",
"Height_Percentile =  ZtoPercentile(Z_Score_Height);",
"",
"if (doCalc) Height_Percentile_param.value = fixDP(Height_Percentile, dp);",
"",
"",
"",
"Weight_for_Height_Percentile =  ZtoPercentile(Z_Score_Weight_for_Height);",
"",
"if (doCalc) Weight_for_Height_Percentile_param.value = fixDP(Weight_for_Height_Percentile, dp);",
"",
"",
"",
"",
"if (doCalc){",
"",
"rrclr();",
"if (Z_Score_Height > -2){ document.getElementById('rr1_1').bgColor = \"#cccccc\";",
"}",
"if ((Z_Score_Height > -3) && (Z_Score_Height <= -2)){ document.getElementById('rr1_2').bgColor = \"#cccccc\";",
"}",
"if (Z_Score_Height <= -3){ document.getElementById('rr1_3').bgColor = \"#cccccc\";",
"}",
"",
"",
