"}",
"if ((Z_Score_Height > -3) && (Z_Score_Height <= -2)){ document.getElementById('rr1_2').bgColor = \"#cccccc\";",
"}",
"if (Z_Score_Height <= -3){ document.getElementById('rr1_3').bgColor = \"#cccccc\";",
"}",
"if (Z_Score_Weight_for_Height > -2){ document.getElementById('rr2_1').bgColor = \"#cccccc\";",
"}",
"if ((Z_Score_Weight_for_Height > -3) && (Z_Score_Weight_for_Height <= -2)){ document.getElementById('rr2_2').bgColor = \"#cccccc\";",
