var title_f29_32_30219="CRC chemo elderly guide";
var content_f29_32_30219=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F71132&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F71132&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Guidelines for evaluating the suitability of chemotherapy in elderly patients with CRC",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Fitness category",
"      </td>",
"      <td class=\"subtitle1\">",
"       Criteria",
"      </td>",
"      <td class=\"subtitle1\">",
"       Suitability of chemotherapy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Group I: fit",
"      </td>",
"      <td>",
"       Totally independent",
"      </td>",
"      <td rowspan=\"2\">",
"       Full-dose treatment, assuming life expectancy is longer than the life expectancy from cancer",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       No serious comorbidity",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Group II: intermediate",
"      </td>",
"      <td>",
"       Dependent in one or more IADLs or with some comorbidity",
"      </td>",
"      <td>",
"       Consideration of chemotherapy dose reduction for first administration",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"3\">",
"       Group III: frail",
"      </td>",
"      <td>",
"       Dependence in one or more ADLs",
"      </td>",
"      <td rowspan=\"3\">",
"       Not suitable for chemotherapy; supportive care recommended",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Three or more comorbid conditions",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       One or more geriatric syndromes",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ADLs: activities of daily living (eg, transferring, grooming, continence, using the toilet, dressing, feeding); IADLs: instrumental activities of daily living (eg, transportation, money management, shopping, taking medications, preparing meals).",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Kohne CH, Folprecht G, Goldberg RM, et al. Chemotherapy in Elderly Patients with Colorectal Cancer. The Oncologist 2008; 13:390. Copyright &copy; 2008 AlphaMed Press.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
